/*ReinforcedManagementReport = Lista de Informe Reforzado*/
import React, { useState } from "react"
import PropTypes from 'prop-types';
import { useLocation } from 'react-router-dom'
import { Link } from "react-router-dom"


import {
  Card,
  CardBody,
  Col,
  Button,
  CardFooter,
} from "reactstrap"

//Import Breadcrumb
import Breadcrumbs from "../../../../components/Common/Breadcrumb"

//i18n
import { withTranslation } from "react-i18next"

import DatosGenerales from "./DatosGenerales"
import ResultadosBusqueda from "./ResultadosBusqueda"
import ApiServicesDetalleAbogado from "../../../../services/Abogado/ApiServicesDetalleAbogado"


const PantallaBusqueda = props => {

  const location = useLocation()
  const { selectedData } = location;

  const [showResults, setShowResults] = useState(false);
  const [dataList, setDataList] = useState([]);


  React.useEffect(() => {
    // Read Api Service data
    searchData(null)
  }, []);


  function searchData(values) {
    // console.log(values);
    const api = new ApiServicesDetalleAbogado()
    api.getResultadoDetalleAbogadoMode(values)
      .then((data) => {

        // console.log(data);
        setDataList(data);

      })
      .catch((error) => {

        console.error('Error fetching documents', error);
      });
  }


  return (
    <React.Fragment>

      <div className="page-content">

        <Breadcrumbs title={props.t("CommercialCredit")} breadcrumbItem={props.t("Lawyer")} />

        <Card>
          <CardBody>
            {/* <DatosGenerales  /> */}
            <ResultadosBusqueda results={dataList} />

          </CardBody>
          <CardFooter style={{ textAlign: "right" }}>
            <Link className="btn btn-dark" style={{ margin: '5px' }} to={{ pathname: "/dashboard", selectedData: undefined }}>{props.t("Close")}</Link>

            <Button id="btnSave" color="success" type="submit" style={{ margin: '5px' }}>
              {props.t("Advance")}
            </Button>

          </CardFooter>
        </Card>

      </div>

    </React.Fragment>
  )
}


export default (withTranslation()(PantallaBusqueda))
